description:
Herhangi bir boyarmadde içermemektedir . Çocuklarınızın ve çevrenizin sağlığı için kaz tüyü bebek taşıma kundağımızda yalnızca %100 pamuklu kumaş kullanılmıştır.&nbsp;
&nbsp;
Doğal elyaf olan pamuğun nefes alma özelliği sayesinde hem sağlıklı ve doğal hem de konforlu bir uykuyu yaşayabilirsiniz.
&nbsp;
Ürünlerimizde kullanılan kaz tüyü içeriği özellikle bebeklerimizin hassasiyeti düşünülerek tercih edilmiş ve tasarlanmıştır. Bebek taşıma kundağı dolgumuz&nbsp;% 90 gıdık % 10 sırt tüyünden oluşmaktadır.&nbsp;
&nbsp;
Kaz Tüyü ;
Higroskopi özelliğine sahiptir.&nbsp;
Isı ve nem dengeleyicir.
Ortamdaki nemi emer, kullanılmadığında geri bırakır.
En hafif dolgu maddesidir.
Doğal, hafif, sağlıklı ve yumuşaktır.
Gıdık ve sırt tüyü oranına göre özellikleri değişir.
Yıkanabilir.
&nbsp;
Yıkama Talimatı;
Kuru temizleme öncelikli olarak tavsiye edilir. Evde yıkanılacaksa 30°C sıcaklıkta yıkanması önerilir. Kurutma makinasında hassas programda iyice kuruduğundan emin olacak şekilde kurutulmalıdır.&nbsp;
Kaz tüyü yastıkların her gün yatağı toplarken karşılıklı kenarlarından kuvvetlice vurmak suretiyle havalandırılması ve kabartılması, yorganların haftada en az bir kere hafifçe ve her seferinde değişik kenarlarından tutularak silkelenip havalandırılması önemlidir. Bu sayede dolguyu gevşetmiş ve yeniden kabartarak nemden arınmasını sağlamış oluruz.&nbsp;
&nbsp;
Ürünlerimizin tamamı Türkiye’de üretilmiştir.

